import React, { Component } from "react";
import { Row, Col } from "antd";
import Menu from "../components/Menu";
import Logo from "../components/Logo";



export class Home extends Component {
  render() {
    return (
      <Row type="flex" align="middle" style={{background: "#0a262e"}}>
          <Col span={24} style={{textAlign: "center"}}>
              <Logo/>
              <Menu/>
          </Col>
          <Row type="flex" style={{marginTop: "10px", backgroundColor: "#f3f7f8", marginLeft: "auto", marginRight: "auto", width: "800px"}}></Row>
      </Row>
    );
  }
}

export default Home;
